jQuery(document).ready(function(a){a(".gallery-zip").click(function(b){b.preventDefault();if(undefined!==GalleryZip.ajaxurl){a.post(GalleryZip.ajaxurl,{action:"get_galleryzip",post_id:a(this).attr("post-id"),gallery_id:a(this).attr("gallery-id")},function(c){if(undefined!==c.result){if(false!==c.result){document.location=c.result}else{alert("Could not create zip")}}else{alert("Sorry, but something went wrong while creating the zip file.")}})}})});